class Solution {
    func minOperations(_ nums: [Int], _ k: Int) -> Int {
        var xorSum = nums.reduce(0) { $0 ^ $1 }
        xorSum ^= k

        if xorSum == 0 { return 0 }

        var counts = Array(repeating: 0, count: 31)
        for num in nums {
            for i in 0..<31 {
                if (num & (1 << i)) != 0 {
                    counts[i] += 1
                }
            }
        }

        var ops = Int.max
        for i in 0..<31 {
            if (xorSum & (1 << i)) != 0 {
                ops = min(ops, min(counts[i], nums.count - counts[i]))
            }
        }

        return ops == Int.max ? -1 : ops
    }
}
